import React from 'react';

const transcriptText = [
  <p key={1} role="paragraph">Ladies and gentlemen of the Elite Hoops Club, Today, we are united in our efforts in the basketball court.</p>,
  <p key={2} role="paragraph">Each of us is touched by the thrill of the game and by choosing to push our limits we can reach new heights.</p>,
  <p key={3} role="paragraph">But allow me to remind you, the road to progress is not without hardships.</p>,
  <p key={4} role="paragraph">It is in overcoming these obstacles that we need to educate ourselves as athletes.</p>,
  <p key={5} role="paragraph">So I urge each of you to embrace the journey early with commitment and flexibility.</p>,
  <p key={6} role="paragraph">Let's step out of our comfort zone and support each other as teammates.</p>,
  <p key={7} role="paragraph">Let's come together as members of the Elite Hoops Club to write a success story.</p>,
  <p key={8} role="paragraph">Cheer each other on and prove that with patience and insight, anything is possible on the court.</p>,
  <p key={9} role="paragraph">Thank you.</p>
];

export default transcriptText;
